// AdUpdate.js
import React, { useState, useEffect } from 'react';
import {Link, useParams } from 'react-router-dom';
import './update.css';
function UpdateAd() {
  const { id } = useParams();
  const [ad, setAd] = useState({
    name: '',
    eventDate: '',
    city: '',
    category: '',
    photo: '',

  });
  const [updateStatus, setUpdateStatus] = useState('');
  const [formValues, setFormValues] = useState({});

  useEffect(() => {
    
    fetch(`http://localhost:8080/ad/${id}`)
      .then((response) => response.json())
      .then((data) => {
        setAd(data);
      })
      .catch((error) => {
        console.error('Erreur lors de la récupération des détails de l\'annonce:', error);
      });
  }, [id]);

  const handleUpdate = () => {
  
    const handleUpdate = () => {
        // Effectuez une requête pour mettre à jour l'annonce avec les détails de formValues
        // Utilisez fetch ou Axios pour envoyer les données au serveur
        fetch(`http://localhost:8080/ad/${id}`, {
          method: 'PUT',
          headers: {
            'Content-Type': 'application/json',
          },
          body: JSON.stringify(formValues),
        })
          .then((response) => {
            if (response.ok) {
              setUpdateStatus('Mise à jour réussie');
            } else {
              setUpdateStatus('Erreur lors de la mise à jour de l\'annonce');
            }
          })
          .catch((error) => {
            setUpdateStatus('Erreur lors de la mise à jour de l\'annonce: ' + error.message);
          });
      };
    
      const handleChange = (e) => {
        const { name, value } = e.target;
        setFormValues({
          ...formValues,
          [name]: value,
        });
      };
    
      return (
        <div className="ad-update">
          <h1>Mise à jour de l'annonce</h1>
          <form>
            <input
              type="text"
              name="name"
              value={formValues.name}
              onChange={handleChange}
            />
            <input
              type="text"
              name="city"
              value={formValues.city}
              onChange={handleChange}
            />
              <input
              type="text"
              name="date"
              value={formValues.eventDate}
              onChange={handleChange}
            />
        
              <input
              type="text"
              name="category"
              value={formValues.category}
              onChange={handleChange}
            />
       
       <input
              type="text"
              name="date"
              value={formValues.photo}
              onChange={handleChange}
            />
 <button type="button" onClick={handleUpdate}>Enregistrer</button>
        <Link to={`/ad-details/${id}`}>Retour</Link>
      </form>
      {updateStatus && <p>{updateStatus}</p>}
    </div>
  );
}

}

export default UpdateAd;
